import React from "react";
import { makeStyles } from "@material-ui/core";
import { Drawer } from "@material-ui/core";

const useStyles = makeStyles((theme) => ({}));

function SideBar() {
  const classes = useStyles();
  return (
    <div>
      <Drawer
        docked={false}
        width={200}
        open={true}
        variant="permanent"
      ></Drawer>
    </div>
  );
}

export default SideBar;
